  [],\n\t\"revision_timestamp\": \"2016-04-06T23:20:22.149341\",\n\t\"name\": \"effect-of-erythropoiesis-stimulating-agent-policy-decisions\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>Erythropoiesis-stimulating agents (ESAs)
  are used as a treatment for anemia in myelodysplastic syndromes (MDS) patients.
  In early 2007, the U.S. Food and Drug Administration released safety warnings about
  ESA use in non-MDS cancer patients. In August 2007, the Centers for Medicare and
  Medicaid Services restricted the coverage of ESAs for Medicare non-MDS cancer patients.
  Researchers report in Effect of Erythropoiesis-Stimulating Agent Policy Decisions
  on Off-Label Use in Myelodysplastic Syndromes, published in Volume 4, Issue 4 of
  Medicare and Medicaid Research Review, that the FDA and CMS policies unintentionally
  lowered ESA use in Medicare MDS patients by 7.9 percent by the first half of 2008.
  The policies did not conclusively improve the appropriateness of ESA use, as concordance
  with two out of the three treatment guidelines that were examined worsened by the
  first half of 2008.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
